import React, { Fragment } from "react"

const ConvasUsers = (props) => {
    console.log(props.FileId);
    return (
        <Fragment>
            <div class="offcanvas offcanvas-start" tabindex="-1" id="offcanvasUsers" aria-labelledby="offcanvasUsers">
                <div class="offcanvas-header">
                    <h5 class="offcanvas-title" id="offcanvasUsers">Share it</h5>
                    <button type="button" class="btn-close text-reset" data-bs-dismiss="offcanvas" aria-label="Close"></button>
                </div>
                <div class="offcanvas-body">
                    <div>
                        Some text as placeholder. In real life you can have the elements you have chosen. Like, text, images, lists, etc.
                    </div>
                </div>
            </div>
        </Fragment>
    )
}
export default ConvasUsers;
